import "./Characteristics.css"

export const Characteristics = () => {
    return(
        <div className="characteristics-container">
            <div className="title">
                Aguante breuk loco la concha de la lora
            </div>
            <div className="image-container">
                 <img src="https://cdn.pixabay.com/photo/2013/07/13/11/34/owl-158414_1280.png" alt="foto" />
            </div>

        </div>
    )
}
